window.bookSummaryJSON = "<p>Here is a secret: There are many monsters in the world. Just like human beings, the monsters go to school, go to work, and have fun with friends. But because human beings have little knowledge about and often misunderstand them, they have to appear like normal people when they're together with humans, except in Monster Inn, where they could be themselves.&nbsp;&nbsp;&nbsp;</p> <p>The boss of the Monster Inn is a young boy named Li Zhixiao. To him, it's an unparalleled challenge to become a part of the monster team and make friends with them. Can he be successful in managing the inn?</p>"; 
